/*Table structure for table `parcela` */

DROP TABLE IF EXISTS `parcela`;

CREATE TABLE `parcela` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `dataPagamento` datetime DEFAULT NULL,
  `dataVencimento` datetime DEFAULT NULL,
  `parcela` varchar(255) DEFAULT NULL,
  `situacao` bit(1) NOT NULL,
  `valor` double NOT NULL,
  `mensalidade_id` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `FKfsbv6hqxyqq4rlkd6vnifpn3j` (`mensalidade_id`),
  CONSTRAINT `FKfsbv6hqxyqq4rlkd6vnifpn3j` FOREIGN KEY (`mensalidade_id`) REFERENCES `mensalidade` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;

